	            instructions: "<p><strong>MODE D\u2019EMPLOI POUR D\xC9SINFECTION&nbsp;:</strong> Pour d\xE9sinfecter les surfaces dures, non poreuses et inanim\xE9es, diluer 2 oz de ce produit dans un gallon d'eau (ou dilution \xE9quivalente). Appliquer la solution \xE0 l\u2019aide d\u2019une vadrouille, d\u2019un chiffon, d\u2019une \xE9ponge, d\u2019un pulv\xE9risateur \xE0 g\xE2chette ou d\u2019un pistolet \xE0 pulv\xE9risation grossi\xE8re \xE0 basse pression en vous assurant de bien arroser les surfaces \xE0 traiter. Garder les surfaces trait\xE9es humides pendant 10 minutes, puis retirer l'exc\xE8s de liquide. Pour les applications par pulv\xE9risateur, vaporiser \xE0 une distance de 15 \xE0 20 cm (6 \xE0 8 pouces), puis frotter avec une brosse, une \xE9ponge ou un chiffon. Ne pas respirer les vapeurs ou le brouillard de pulv\xE9risation. Pour les zones tr\xE8s souill\xE9es, le pr\xE9-nettoyage est n\xE9cessaire. Ne pas r\xE9utiliser la solution et pr\xE9parer une nouvelle solution pour chaque utilisation. </p>\n                        <p><strong>MODE D\u2019EMPLOI POUR TUER LES BACT\xC9RIES&nbsp;:</strong>Lorsque dilu\xE9 dans l\u2019eau \xE0 l\u2019\xE9quivalent de 2 oz par gallon US ce produit a d\xE9montr\xE9 son efficacit\xE9 en tant que d\xE9sinfectant contre les organismes suivants : <em>Pseudomonas aeruginosa PRD-10</em>, <em>Salmonella (cholerae suis) ent\xE9rique</em>, <em>Staphylocoque dor\xE9</em>, <em>Escherichia coli</em>, <em>Escherichia coli O111:H8</em>, <em>Fusobacterium necrophorum</em>, <em>l\u2019ent\xE9rocoque r\xE9sistant \xE0 la vancomycine (ERV)</em>, le <em>Staphylocoque dor\xE9 r\xE9sistant \xE0 la m\xE9thicilline (SRDM)</em> et le <em>Staphylocoque aureus interm\xE9diaire \xE0 la vancomycine (SAIV)</em>.</p>\n                        <p><strong>MODE D\u2019EMPLOI COMME FONGICIDE&nbsp;:</strong> Lorsque dilu\xE9 \xE0 l\u2019\xE9quivalent de 2 oz par gallon US ce produit est un fongicide efficace contre les champignons pathog\xE8nes, <em>trichophyton mentagrophytes</em> (le champignon responsable pour le pied d'athl\xE8te) et <em>candida albicans</em>. Appliquer la solution \xE0 l\u2019aide d\u2019un chiffon, d\u2019une \xE9ponge ou d\u2019un pulv\xE9risateur \xE0 g\xE2chette sur les surfaces dures non poreuses qui existent dans les salles de bain, les douches, les vestiaires, les salles d'exercice ou toute autre surface propre, dure et non-poreuse qui entre couramment en contact avec les pieds nus. Garder les surfaces trait\xE9es humides pendant 10 minutes, puis retirer l'exc\xE8s de liquide. Le produit dilu\xE9 doit \xEAtre appliqu\xE9 chaque jour ou plus souvent s\u2019il s\u2019agit d\u2019espaces tr\xE8s fr\xE9quent\xE9s.</p>\n                        <p><strong>MODE D\u2019EMPLOI POUR NETTOYAGE G\xC9N\xC9RAL&nbsp;:</strong> Appliquer ce produit sur la zone souill\xE9e \xE0 l\u2019aide d\u2019une vadrouille, d\u2019un chiffon, d\u2019une \xE9ponge, d\u2019un vaporisateur \xE0 g\xE2chette ou d\u2019un pistolet \xE0 pulv\xE9risation grossi\xE8re \xE0 basse pression. Ce produit peut \xEAtre appliqu\xE9 \xE0 pleine puissance ou dilu\xE9 en utilisant 2 onces du produit par gallon US d\u2019eau (ou dilution \xE9quivalente). Bien arroser la surface souill\xE9e et frotter si n\xE9cessaire.<br>\n                        <strong>MODE D\u2019EMPLOI POUR D\xC9SODORISATION&nbsp;:</strong> Pour d\xE9sodoriser les surfaces, appliquer ce produit en suivant le mode d\u2019emploi pour la d\xE9sinfection. <br>\n                        <strong>MODE D\u2019EMPLOI COMME AGENT ANTIMOISISSURE&nbsp;: </strong>Pour contr\xF4ler les moisissures (<em>Aspergillus Niger</em>) et les odeurs qu'elles occasionnent sur les surfaces dures, inanim\xE9es, pr\xE9-nettoy\xE9s et non poreuses, diluer 2 oz de ce produit dans un gallon US d'eau (ou dilution \xE9quivalente). Appliquer la solution \xE0 l\u2019aide d\u2019un chiffon, d\u2019une vadrouille, d'une \xE9ponge ou d\u2019un vaporisateur \xE0 g\xE2chette en vous assurant que les surfaces soient bien arros\xE9es. Laisser s\xE9cher les surfaces \xE0 l'air libre. Ne pas r\xE9utiliser la solution et pr\xE9parer une nouvelle solution pour chaque utilisation. R\xE9appliquer chaque semaine ou lorsque la moisissure r\xE9appara\xEEt.<br>\n                        <strong>Remarque&nbsp;:</strong> Consulter l'\xE9tiquette du produit pour de plus amples informations concernant la s\xE9curit\xE9 et l'utilisation du produit ainsi que la liste compl\xE8te des agents pathog\xE8nes.</p>",
