	            faq: "<h6>Ce produit tue-t-il la moisissure&nbsp;?</h6> <p><strong>Oui.</strong> Le tueur de moisissures Moldex<span class=\"sup\">&reg;</span>, lorsqu'il est utilis\xE9 selon le mode d\u2019emploi recommand\xE9, est efficace contre un vaste spectre de bact\xE9ries. C\u2019est un virucide* et un fongicide et il emp\xEAche la formation de moisissure et des odeurs qu\u2019elles occasionnent.</p>\n                    <br>\n                    <h6>Ce produit contient-il du javellisant&nbsp;?</h6> <p><strong>Non.  </strong>Le tueur de moisissures Moldex<span class=\"sup\">&reg;</span> est une solution d'ammonium quaternaire enregistr\xE9 aupr\xE8s de l\u2019Agence am\xE9ricaine de protection de l\u2019environnement. Les chlorures d'ammonium quaternaire sont non corrosifs, ce qui les rend plus doux pour les surfaces et les \xE9quipements. Le javellisant (qui a comme ingr\xE9dient actif l\u2019hypochlorure de sodium) est tr\xE8s efficace pour \xE9liminer la d\xE9coloration occasionn\xE9e par la moisissure, mais il ne tue pas n\xE9cessairement la microflore qui permet aux moisissures de se former.</p>\n                    <br>\n                    <h6>Le tueur de moisissures Moldex<span class=\"sup\">&reg;</span> enl\xE8ve-t-il les taches\xA0de moisissures&nbsp;?</h6>\n                    <p><strong>Oui et non. </strong>La moisissure, lorsqu\u2019elle n\u2019est pas trait\xE9e, peut occasionner des taches de moisissures noires, laides et bien incrust\xE9es. Dans certains cas, le tueur de moisissures Moldex\xAE enl\xE8vera les taches. Dans d'autres cas, un d\xE9tachant plus agressif sera n\xE9cessaire. Le tueur de moisissures Moldex<span class=\"sup\">&reg;</span> est un excellent produit qui nettoie sans acide. Il enl\xE8ve la salet\xE9, la graisse, la crasse, les taches de nourriture, les r\xE9sidus de savon, les empreintes digitales, les traces de crayons de plomb et de crayons de cire et les marques de talons, mais il NE contient PAS de javellisant ou d\u2019agent de blanchiment. Si vos taches de moisissure sont bien incrust\xE9es, nous vous recommandons d'utiliser l'un de nos d\xE9tachants&nbsp;: le <a href=\"deep_stain_remover.html\">d\xE9tachant en profondeur sans javellisant </a> ou le <a href=\"../instant-mold-mildew-stain-remover.html\">d\xE9tachant de moisissure instantan\xE9</a> \xE0 base de javellisant.</p>\n                    <br>\n                    <h6>Sur quelles surfaces puis-je utiliser ce produit&nbsp;? Peut-il \xEAtre utilis\xE9 \xE0 l'ext\xE9rieur&nbsp;?</h6>\n                    <p>L'Agence am\xE9ricaine de protection de l\u2019environnement a approuv\xE9 notre produit pour \xEAtre utilis\xE9 sur une vari\xE9t\xE9 de surfaces. Vous pouvez consulter la liste compl\xE8te des surfaces approuv\xE9es par l\u2019Agence am\xE9ricaine de protection de l\u2019environnement <a href=\"downloads/approved_surfaces.pdf\">ici</a>.</p>",
